import React, { useState } from "react";
import data1 from './itemdata1';
import { Link } from "react-router-dom";
const Card = () => {
  const [shop1, setshop1] = useState(data1);
  const displayLaptopData = () => {

    return shop1.map((laptop) => (
      <div className="col-md-3 mb-4">
        <div className="card">
          <img src={laptop.img} alt="" style={{width:304, height:200}}/>
          <div className="card-body">
            <h4>{laptop.name}</h4>
            <p>{laptop.rating} avg rating </p>
            <p>{laptop.reviews} reviews</p>
            <h2>â‚¹{laptop.price}</h2>
            <Link to={laptop.Link}>
            <button className="btn btn-primary">Open</button></Link>
          </div>
        </div>
      </div>
    ));
  };
  return (
    <div>
      <div className="card mt-3" style={{ width: "18rem", maxHeight: "360px" }}>
        <img className="card-img-top" src="" alt="Card image cap" style={{height:"120px" ,objectFit:"fill"}} />
        <div className="card-body">
          <h5 className="card-title">Card title</h5>
          <p className="card-text">Imp text</p>
          <div className="container w-100">
            <select className="m-2 h-100 bg-success rounded">
              {Array.from(Array(6), (e, i) => {
                return (
                  <option key={i + 1} value={i + 1}>
                    {i + 1}
                  </option>
                );
              })}
            </select>
            <select className="m-2 h-100 bg-success rounded">
              <option value="half">Half</option>
              <option value="full">Full</option>
            </select>
            <div className="d-inline h-100 fs-5">Total Price</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
